import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';  // Import Link for navigation
import Login from './Login';  // Assuming you have a Login component
import Signup from './Signup';  // Assuming you have a Signup component

const App = () => {
  return (
    <Router>
      <div>
        <h1>Welcome to the Authentication App</h1>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          {/* Default route */}
          <Route path="/" element={<Login />} /> {/* Redirect to login page */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
